import React from "react";
import { NavLink, Outlet } from "react-router-dom";

const ContactUsNavbar = () => {
  const mystyle = {
    backgroundImage: "url('backgroundimg.jpg')",
    height: "93vh",
    padding: "50px",

    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
  };
  const paragraphStyle = {
    margin: "0",
    padding: "10px",
    fontSize: "1.2em",
    lineHeight: "1.8",
    // textAlign: "left",
  };
  const listStyle = {
    marginleft: "0",
    padding: "10px",
    fontSize: "1.2em",
    lineHeight: "1.8",
    textAlign: "left",
  };
  const nested = {
    fontSize: "1.2em",
  };
  return (
    <div style={mystyle}>
      <br />

      <h1>Get in touch with us here.</h1>

      <p style={paragraphStyle}>
        Thank you for your interest in our App. If you have any questions about
        our products, services, or would like to provide feedback, please feel
        free to contact us. We would love to hear from you!
      </p>
      <ul style={listStyle}>
        <li>
          <strong>Address:</strong> 123 Main Street, City, State, Zip Code
        </li>
        <li>
          <strong>Phone:</strong> +1 (123) 456-7890
        </li>
        <li>
          <strong>Email:</strong> info@yourcompany.com
        </li>
      </ul>
      <div style="nested">
        <NavLink to="youtube">Youtube</NavLink>
        <br />
        <NavLink to="twitter">Twitter</NavLink>
        <br />
        <NavLink to="facebook">FaceBook</NavLink>
        <br />
        <NavLink to="github">GitHub</NavLink>
      </div>
      <Outlet />
    </div>
  );
};

export default ContactUsNavbar;
